    "biography": "From Wikipedia, the free encyclopedia\n\nJoel Heyman (born September 16, 1971) is an Actor who is frequently used in Rooster Teeth Productions machinima series, including Red vs. Blue as Private Michael J. Caboose/O'Malley and The Strangerhood as Wade, as well as Bidderman in 1-800-MAGIC. He also wrote 1-800-MAGIC, and occasional Rooster Teeth Shorts for Rooster Teeth Productions. In addition to his involvement in machinima, he starred in The Schedule, a live-action film written and directed by Burnie Burns (creator of Rooster Teeth Productions). He frequently is a Co-Host in Rooster Teeth Productions weekly podcast \"Drunk Tank\". He has also done a range of acting roles on American television shows including Friends, Angel, The Inside, Alias, Criminal Minds, and reprising his Red vs. Blue role as a Blue Prison Guard in the G4 show, Code Monkeys. He had a minor role in Halo 3 as an unseen marine, voiced in the character of Caboose from Red vs. Blue.\n\nJoel is a 1997 graduate of the University of Texas at Austin, where he received a Bachelor of Fine Arts degree in Drama Production. He currently resides in Austin, Texas, to work in the Rooster Teeth offices.\n\nDescription above from the Wikipedia article Joel Heyman,licensed under CC-BY-SA, full list of contributors on Wikipedia.", 
