    "biography": "\u200bFrom Wikipedia, the free encyclopedia. \u00a0\n\nKatharine Payne Towne (born July 17, 1978) is an American actress. Towne was born in Hollywood, California, the daughter of actress Julie Payne and Robert Towne, an Oscar-winning screenwriter, director, and actor. Towne's career began with a small role in the 1998 movie Girl. She then appeared in Go, She's All That, But I'm a Cheerleader and The Bachelor, as well as guest-starring as Sunday on Buffy the Vampire Slayer. In 2000, Towne starred as Riley on NBC's short-lived sitcom M.Y.O.B. Since then she has appeared in a number of feature films, including The In Crowd, What Lies Beneath, Town &amp; Country, Mulholland Drive, Evolution, Something New and Blades of Glory. She also played a character called Erin in Sweet Home Alabama; her scenes didn't make the final cut, but were included on the film's DVD release. Towne played Mason on HBO's Tell Me You Love Me. Towne was married to English actor Charlie Hunnam from 1999 to 2002\n\nDescription above from the Wikipedia article\u00a0Katharine Towne, licensed under CC-BY-SA, full list of contributors on Wikipedia.", 
