    "biography": "From Wikipedia, the free encyclopedia\n\nJoel Polis (born October 3, 1951) is an American television, film and stage actor. He has appeared in over one hundred television programs and films during his career. Polis' first film role was the character 'Fuchs' in the science fiction film The Thing. He appeared in numerous television series including Cheers, Alien Nation, Northern Exposure, Star Trek: Voyager, Roseanne, Seinfeld, Chicago Hope, Boston Legal and CSI. He appeared in a recurring role on the television series Cheers as the mischievous Gary, owner of the rival bar, Gary's Olde Towne Tavern. Polis's theater credits include performances at the Astor Place Theatre, Hartford Stage, Old Globe Theater, South Coast Repertory, Mark Taper Forum, Odyssey Theatre, Laguna Playhouse, Lillian Theater and the Pasadena Playhouse.", 
